  return(
    <div className='header'>
      <Title/>
      <div className='navitems'>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const Body =() =>{
  return(
    <h1>Body</h1>
  )
}
const Footer =() =>{
  return(
    <h1>Footer</h1>
  )
}
const Applayout = ()=>{
  return(
    <>
    <HeaderComponent/>
     <Body/>
     <Footer/>
      </>
  );
}

export default App;
